DROP TABLE IF EXISTS `events`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `events` (
  `id` int NOT NULL AUTO_INCREMENT,
  `userId` int NOT NULL,
  `name` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `description` text COLLATE utf8mb4_general_ci NOT NULL,
  `image` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `address` text COLLATE utf8mb4_general_ci,
  `location` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `eventDate` date DEFAULT NULL,
  `fromTime` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `toTime` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `eventPrice` double(20,6) DEFAULT '0.000000',
  `eventDiscount` int DEFAULT '0',
  `mobileNumber` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `status` int NOT NULL DEFAULT '1' COMMENT '0=non_active, 1= active',
  `isHighlights` int NOT NULL DEFAULT '0' COMMENT '0=not_highlights, 1= highlights',
  `addedBy` int DEFAULT NULL COMMENT '1 - admin, 2 - vendor',
  `isDeleted` int NOT NULL DEFAULT '1' COMMENT '1 - not deleted , 0 - deleted',
  `datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=97 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

