nium hotel, Dubai Marina\r\n\r\nDM now for early bird Ticket deal💨💨\r\nhttps://www.instagram.com/mingledxb/','image-1725121527258.photo_2024-08-27_17-11-57.jpg','Dubai Marina','Dubai','2024-09-05','20:00','23:59',0.000000,0,'',0,0,1,0,'2024-08-31 16:25:27'),(91,6,'Apocalyptica plays Metallica','World-renowned Finnish symphonic metal band Apocalyptica make their highly anticipated Dubai debut on September 13th at The Agenda, Media City. \r\n\r\nThe band is touring in support of the follow-up to their legendary debut record with the PLAYS METALLICA VOL. 2 TOUR 2024. \r\n\r\nApocalyptica\'s unique and carefully crafted interpretations of Metallica\'s biggest hits have enthralled fans, and the Dubai leg is part of their broader European Tour.\r\n\r\nThis concert promises an unforgettable night for Metallica and Apocalyptica fans alike, continuing the journey that began in 1996 with countless shows to their name; these classically-minded dynamos are returning to their roots, bringing a legendary story full circle. \r\n\r\nTo purchase tickets, please visit: \r\nhttps://dubai.platinumlist.net and enter code TS15 to get your 15% discount on tickets!\r\n\r\n','image-1725687508956.apocalyptica_plays_metallica_2024_sep_13_the_agenda_91304_full_en1709119090.webp','The Agenda','Dubai','2024-09-13','19:00','23:59',0.000000,15,'',0,0,1,0,'2024-09-07 05:38:28'),(92,6,'Schools Out Event','MingleDXB is delighted to bring you ‘SCHOOLS OUT’!\r\n\r\nThis event will give teachers the chance to meet, socialize and unwind in a cool and relaxed venue 🪩\r\n\r\n*This event is for all, not just singles*\r\n\r\nFriday 27th September, 2pm - 6:30pm\r\n\r\nLocation: IKIGAI, Dubai Marina\r\n\r\nLadies 2 hours free flow wine \r\n(Then 99 unlimited package 4pm-6pm)\r\n\r\nMen 149 unlimited house drinks 2pm - 6.30pm','image-1726034714122.photo_2024-09-11_10-00-13.jpg','Ikigai','Dubai Marina','2024-09-27','14:00','18:30',0.000000,0,'',0,0,1,0,'2024-09-11 06:05:14'),(93,101,'test','test','image-1726047348373.istockphoto-1269776313-612x612.jpg','test','test','2024-09-12','19:09','23:13',5324.000000,3,'345344534534543',0,0,2,0,'2024-09-11 09:35:48'),(94,572,'The Dylan Show - Tuesday Quiz Night','Join our pub quiz every Tuesday starting at 8pm. \r\n\r\nInternational general knowledge themed quiz including movies, sports, music and more! \r\n\r\nMusic bingo, games and raffle draw are all part of the night as well.\r\n\r\nPrizes include:\r\n🥇 Brunch vouchers\r\n🥈 200 AED off F&B\r\n🥉 100 AED off F&B\r\n🎖️ Spin the wheel to win free stuff on the quiz masters bar tab!','image-1731738587626.WhatsApp Image 2023-06-01 at 09.27.21.jpeg','McGettigans DWTC','McGettigans DWTC','2024-11-19','20:00','23:00',0.000000,100,'',1,0,1,1,'2024-11-16 06:27:36'),(95,572,'The Dylan Show Thursday Quiz Night','Join our Fuel for Thought quiz night every Thursday starting at 7pm. \r\n\r\nInternational general knowledge quiz including categories such as movies, sports, music and more!\r\n\r\nMusic bingo, games and raffle draw are all part of the night as well.\r\n\r\nPrizes include:\r\n🥇 500 AED off F&B (1st place)\r\n🥈 250 AED off F&B (2nd place)\r\n🥉 150 AED off F&B (3rd place)\r\n🎖️ Spin the wheel to win free stuff on the quiz masters bar tab!','image-1732081822660.Screenshot 2024-11-20 094959.jpg','JLT','TJ\'s JLT','2024-11-21','19:00','23:00',0.000000,100,'',1,0,1,1,'2024-11-20 05:42:18'),(96,572,'🎉 Garmin Fitness Festival – The Ultimate Family Hangout! 🎉','🎟️ Your Ticket to AED 1 Million in Prizes! 🎟️ Don\'t miss your chance to win big at the Garmin Fitness Festival on November 30th! With over AED 1 million in prizes up for grabs, this is your moment to compete, challenge yourself, and take-home incredible rewards\r\n_____________________________________________________\r\nBuckle Up for Big Wins - 3 GAC Empow Cars Up For Grabs!\r\n\r\n🎉 Garmin Fitness Festival – The Ultimate Family Hangout! 🎉\r\nWhether you\'re racing or just there for the fun, the Garmin Fitness Festival has something for everyone! Bring the whole family and enjoy: 🎶 Live music 🍔 Food stalls 💪 Fitness challenges 🎯 Fun zones Join us on November 30th for a day of excitement, fitness, and entertainment for all ages! Get your tickets now: www.garminfitnessfestival.com #ShareYour30 #GarminAE #GFF #AmitInt\r\n_____________________________________________________\r\n\r\nGo for Gold at the Garmin Fitness Festival! 🏅 With over AED 1 million in prizes up for grabs, this is your chance to win big! Don’t miss out on the opportunity to race, challenge yourself, and walk away with amazing rewards. Join us on November 30th and compete for your share of the prizes! Book your ticket today: www.garminfitnessfestival.com #ShareYour30 #GarminAE #GFF #AmitInt\r\n_____________________________________________________\r\n\r\nFor more information on timings and prices, please visit our site: https://garminfitnessfestival.com/','image-1732104175923.PMax Campaign rev 4_Dress to Impress1080 x 1080 copy.jpg','Dubai Expo','Dubai Expo','2024-11-30','06:00','20:00',0.000000,0,'',1,0,1,1,'2024-11-20 12:02:55');
