DROP TABLE IF EXISTS `offersList`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `offersList` (
  `id` int NOT NULL AUTO_INCREMENT,
  `userId` int NOT NULL,
  `offerCategoryId` int DEFAULT NULL,
  `offerName` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `offerDescription` text COLLATE utf8mb4_general_ci NOT NULL,
  `offerTermsAndCondition` text COLLATE utf8mb4_general_ci NOT NULL,
  `offerAddress` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `offerLocation` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `offerPrice` double(20,8) DEFAULT '0.00000000' COMMENT 'AED',
  `offerCode` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `status` int NOT NULL DEFAULT '1' COMMENT '0=inActive,1=Active',
  `isApproved` int NOT NULL DEFAULT '0' COMMENT '0=pending, 1= approved, 2= unapproved',
  `offerPercent` int NOT NULL,
  `offerType` int DEFAULT NULL COMMENT '1=special Offer,2=normal Offer, 3= free',
  `brandLogo` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `isOfferFree` int DEFAULT '0' COMMENT '0-paid, 1-free',
  `isDeleted` int NOT NULL DEFAULT '1' COMMENT '0-Deleted, 1-Not Deleted',
  `datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=312 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

