ndore',30.00000000,'9206',0,1,2,2,NULL,0,1,'2023-11-21 09:44:59'),(28,27,3,'GAMING FOR ALL','Free Gaming 2','<p><br></p>','Indore','Indore',100.00000000,'4662',0,2,20,1,NULL,0,0,'2023-11-21 09:47:28'),(29,27,3,'VG','Free Gaming 3','<p>TC</p>','Indore','Indore',40.00000000,'8435',0,1,2,3,NULL,0,1,'2023-11-21 09:48:12'),(30,27,2,'FitFreak','Being the foodie country that India is, there’s a meal planned around every time of the day and food available on every corner. Appetizers served in Indian restaurants are typically popular Indian street foods.','<p><br></p>','Indore','Indore',100.00000000,'5233',0,1,12,3,NULL,0,1,'2023-11-21 10:40:21'),(31,88,5,'Bike Safari','Motorbiking Tours in India Experiencing the best of India by riding on a motorcycle is numinous feeling; it\'s fearful, beautiful yet fascinating. It\'s perhaps the best expedition that beckons the little adventurer in all of us who wants to explore every length and breadth of India. Meandering roads and abundant scenic beauty makes India a famous motorbiking destination amongst the travellers.  In India, there are some of the deadliest roads that will take you to some hidden captivated hamlets that are as perfect as a picture. The country is nature\'s bounty. In the South-East Asian region, India is the favourite choice of motorbiking lovers. If you are the one who is born to tour wild on roads then the trails in India is the wisest choice. As exciting as it sounds, bikers go out of the way to explore the little adventurer in them. Pass through the smallest roads, camp almost day and see the country with a new angle. Indulging in a few motorcycle tours is probably the most adventurous ways to explore destinations.','<p>Motorbiking Tours in&nbsp;India Experiencing the best of India by riding on a motorcycle is numinous feeling; it\'s fearful, beautiful yet fascinating. It\'s perhaps the best expedition that beckons the little adventurer in all of us who wants to explore every length and breadth of India. Mean