and name came into existence in 2009 with a rebranding from Radisson SAS. Its hotels are found in major cities, key airport gateways and leisure destinations. ','<p><br></p>','Dubai','Dubai',0.00000000,'4489',0,2,20,2,'image-1717006235149.png',0,0,'2024-05-29 18:10:35'),(85,200,19,'Radisson Red','Welcome to Radisson RED; a playful twist on the conventional. From amazing everyday essentials to Instagrammable statements, RED delivers a stand-out experience. Welcoming and fashionable hotels in the beating heart of buzzing destinations.','<p><br></p>','Dubai','Dubai',0.00000000,'3859',0,2,20,2,'image-1717006376522.png',0,0,'2024-05-29 18:12:56'),(86,200,19,'Media One Hotel','At the crossroads of Dubai Marina and Dubai Media City, our rooms provide a 360 degree view of the Palm Jumeirah, the city skyline or the ever busy Sheikh Zayed Road.  Stylish, contemporary & welcoming, our rooms depict an ageless, contemporary design, brought to life by LW Design at one of the best hotels in Dubai.','<p><br></p>','Dubai','Dubai',0.00000000,'7091',0,2,20,2,'image-1717006579637.png',0,0,'2024-05-29 18:16:19'),(87,200,19,'Taj Hotel','Taj Dubai stands as an urban icon in one of the world\'s most dynamic and exhilarating cities. Boasting world-class dining, wellness facilities, and a range of activities, it distinguishes itself among the Taj hotels in Dubai.','<p><br></p>','Dubai','Dubai',0.00000000,'2561',0,2,20,2,'image-1717006702394.png',0,0,'2024-05-29 18:18:22'),(88,200,19,'Hilton Hotel','This 5-star Hilton resort is located on Dubai\'s The Walk at Jumeirah Beach Residence, offering shopping, dining, and leisure activities. The swimming pool is set within the hotel gardens enclosed by a private beach with sun loungers. Rooms at the Hilton Dubai Jumeirah offer partial or full sea views overlooking the Ferris Wheel Ain Dubai.','<p><br></p>','Dubai','Dubai',0.00000000,'1162',0,2,20,2,'image-1717007677784.png',0,0,'2024-05-29 18:34:37'),(89,200,19,'Voco Hotel','Ideally situated across the street from the World Trade Centre and a metro stop with direct links to Dubai\'s most iconic attractions including the Burj Khalifa, Museum of the Future, Dubai International Financial Centre, The Dubai Mall, and Dubai Frame. With 471 contemporary guestrooms designed to elevate your stay, voco® Dubai boasts a perfect fusion of modern comfort and thoughtful amenities.','<p><br></p>','Dubai','Dubai',0.00000000,'6152',0,2,20,2,'image-1717007824518.png',0,0,'2024-05-29 18:37:04'),(90,200,19,'W Hotel','Relax into the good life at the first W Escape in the Middle East. Chase the sun along the pristine Palm Jumeirah coastline with a white-sand private beach, adult only pools, dedicated family activities as well as extraordinary Dubai skyline views. Our luxury 5-star hotel boasts playful design elements and dreamy amenities across 349 guest rooms and suites and is also pet friendly. Experience our two signature venues, the audacious Michelin-Starred Italian restaurant, Torno Subito a Massimo Bottura production, and Michelin Recommended restaurant Akira Back brings you an adrenaline-filled menu of Japanese Korean cuisine; brought to you by the name-sake celebrity chef. WET Deck is an adult’s only playground with a live DJ. Sobe, the only bar on Palm Jumeirah to offer 360-degree views of both the city and the Arabian Gulf, is the perfect place to watch the sunset after an action-packed day. AWAY Spa is your go-to for complete relaxation and the ideal place to disconnect.','<p><br></p>','Dubai','Dubai',0.00000000,'2957',0,2,19,2,'image-1717007937198.png',0,0,'2024-05-29 18:38:57'),(91,200,19,'Dusit Thani Hotel','Dusit Thani Dubai welcomes guests with Emirati elegance and Thai hospitality to a luxurious retreat in the centre of the city.  The hotel is strategically located just five minutes from Dubai’s main business hub, near Dubai Mall and the world-famous Burj Khalifa.  With an array of international dining destinations and full-service events facilities, Dusit Thani Dubai, hotel in Dubai UAE offers comfort and convenience for business and leisure guests.','<p><br></p>','Dubai','Dubai',0.00000000,'4346',0,2,20,2,'image-1717008022343.png',0,0,'2024-05-29 18:40:22'),(92,200,19,'Le Meridian Hotel','Nestled within the verdant heart of 15 hectares of manicured gardens, Le Méridien Dubai Hotel and Conference Centre is a luxurious haven of rest and relaxation, standing next door to Dubai International Airport (DXB). Belonging to the globe\'s most glamorous city, our 5-star congress hotel offers matchless access to Dubai\'s famed business and commercial districts and popular local attractions like Deira City Centre, The Dubai Mall, Dubai Creek Golf and Yacht Club, Burj Khalifa and the Gold Souk. Feel destined to succeed when you begin each day in one of our 18 chic restaurants before experiencing our dynamic city. Attend a sophisticated event in our 44,000 square feet of venue space at our business hotel. Reserve a soothing treatment in our Natural Elements Spa or float away in the azure outdoor pools. Guests can enjoy complimentary two-way shuttle to Dubai Mall & La Mer along with drop off facilities to Dubai International Airport T1 and T3 and DWTC at fixed time schedules. Contact us for more information.','<p><br></p>','Dubai','Dubai',0.00000000,'5660',0,2,20,2,'image-1717008103134.png',0,0,'2024-05-29 18:41:43'),(93,200,14,'Benjarong','So much more than a menu, Benjarong’s mouth-watering selection of Authentic Thai cuisine is a true culinary journey. Carefully crafted and beautifully presented by expert Thai Chef de Cuisine Wichit Panyo and his team, the multi-award-winning cuisine finds the perfect harmony and balance between the five flavours of sweet, spicy, sour, salty, and creamy, by using the freshest, finest-quality ingredients.','<p><br></p>','Dubai','Dubai',0.00000000,'2320',0,2,50,2,'image-1717056986356.png',0,0,'2024-05-30 08:16:26'),(94,200,14,'Fogo De Chao','We are chefs born into the centuries-old grilling tradition of churrasco, respecting our ingredients by cooking them slow and exposing their natural flavors.','<p><br></p>','Dubai','Dubai',0.00000000,'4639',0,2,50,2,'image-1717057089658.png',0,0,'2024-05-30 08:18:09'),(95,200,14,'Qwerty','Delivering an authentic experience inspired by the classic big city business hub of UK. The perfect place as your go-to gastro restaurant and bar for those living and working around Dubai Media City.','<p><br></p>','Dubai','Dubai',0.00000000,'1402',0,2,50,2,'image-1717057243273.png',0,0,'2024-05-30 08:20:43'),(96,200,14,'Garden On The 8','Cheers at garden on 8 — Elevate game day at garden on 8 – with the best beverages, bites and unbeatable vibes. Immerse yourself in the best hops, delicious bites & unmatched ambience at garden on 8. Top Restaurants & Bars. Best Lifestyle Hotel. 4 Star Hotel in Dubai.','<p><br></p>','Dubai','Dubai',0.00000000,'2169',0,2,50,2,'image-1717057305191.png',0,0,'2024-05-30 08:21:45'),(97,200,14,'24th Street','Embark on a culinary journey like no other at 24th St., where the world’s most beloved street foods come together under one roof. Our unique World Street concept features six main kitchens, each dedicated to a distinct cuisine: Korean, Indian, Japanese, Chinese, Italian, and Arabic. Whether you’re craving the bold flavors of Korean BBQ, the intricate spices of Indian curries, or the delicate artistry of Japanese sushi, 24th St. offers an unparalleled dining experience that celebrates the rich diversity of global street food.','<p><br></p>','Dubai','Dubai',0.00000000,'8220',0,2,50,2,'image-1717057373095.png',0,0,'2024-05-30 08:22:53'),(98,200,14,'Jones The Grocer','Cooking and baking honest food and brewing good coffee everyday. Shop artisan grocery, cheese, meat and gifts not in your local supermarket.','<p><br></p>','Dubai','Dubai',0.00000000,'2215',0,2,50,2,'image-1717058381223.png',0,0,'2024-05-30 08:39:41'),(99,200,14,'Eloquent Elephant','The Eloquent Elephant, a quintessential British gastropub, offers both indoor and outdoor seating, along with a creative international menu.','<p><br></p>','Dubai','Dubai',0.00000000,'8875',0,2,50,2,'image-1717058434514.png',0,0,'2024-05-30 08:40:34'),(100,200,14,'Treehouse','An urban rooftop hideaway overlooking Dubai Downtown and Business Bay skyline, Treehouse extends an atmosphere of relaxation and chic above the bustling city. With renovated interiors and upgraded menu offerings, this award-winning lounge & bar spans across two spacious decks, combining the upper deck with the main bar and DJ booth, all presented in minimalistic décor, with a lower deck that features lush greenery with serene and intimate lounge seating and the second bar to a better mixology experience.','<p><br></p>','Dubai','Dubai',0.00000000,'5449',0,2,50,2,'image-1717058515150.png',0,0,'2024-05-30 08:41:55'),(101,200,14,'Nonya','NONYA has expertly curated a culinary melting pot of refined Asian cuisine. Perched on the 44th floor of the luxury Taj Hotel Jumeirah Lakes Towers, the alfresco dining serves premium Pan-Asian dishes in a lively, sleek and terrace venue.','<p><br></p>','Dubai','Dubai',0.00000000,'6656',0,2,50,2,'image-1717058623027.png',0,0,'2024-05-30 08:43:43'),(102,200,14,'Celsius','Showcasing the finest and freshest cuisine and friendly service, Celsius features a bistro-style set up which is perfect for a leisurely repast or a business meal. The renowned International buffet features seasonal European cuisine, highlighted with Middle Eastern culinary touches and our chef’s signature dishes. We also serve an extensive breakfast.','<p><br></p>','Dubai','Dubai',0.00000000,'5886',0,2,50,2,'image-1717058726996.png',0,0,'2024-05-30 08:45:27'),(103,200,14,'Maison Mathis','At Maison Mathis, the hungry guest will be indulged by an extensive selection of fine European food. All-time classics are prepared the way our grannies cooked them. Lesser-known recipes from the past are brought back to life.','<p><br></p>','Dubai','Dubai',0.00000000,'9817',0,2,50,2,'image-1717058817027.png',0,0,'2024-05-30 08:46:57'),(104,200,14,'Bistro Aamara','Bistro Aamara is a celebration of global culinary diversity and cultural richness. Our menu is a testament to our culinary imagination drawn from the countries historically connected by the traditional Silk Route.','<p><br></p>','Dubai','Dubai',0.00000000,'7452',0,2,50,2,'image-1717058878289.png',0,0,'2024-05-30 08:47:58'),(105,200,14,'Warehouse','Inspired by the effortlessly cool aesthetic of New York\'s Soho, Warehouse is a forward-looking lounge space with two restaurants, four wine bars and a beer garden, offering a relaxing repose after your flight into Dubai International Airport.','<p><br></p>','Dubai','Dubai',0.00000000,'3773',0,2,50,2,'image-1717058938561.png',0,0,'2024-05-30 08:48:58'),(106,200,14,'Long Yin','Recreating the rich culinary diversity from the vast topography of China, Long Yin extends the timeless legacy of the far East to Dubai. Deeply rooted in gastronomic traditions, the offerings at Long Yin are a harmonious blend of flavours that are exquisite yet comforting.','<p><br></p>','Dubai','Dubai',0.00000000,'7773',0,2,50,2,'image-1717076639310.long yin logo.jpegpng',0,0,'2024-05-30 08:50:09'),(107,200,14,'Seafood Market','With market-style displays of daily caught fresh fish and shell fish, the restaurant perfectly captures the essence of busy Asian markets amid a cruise-liner themed setting. At Seafood Market diners shop for their meal, choosing the catch of the day from the astonishing array of seafood. The restaurant\'s 18 seawater tanks are home to live oysters from France, lobsters from USA, Australia, Canada and New Zealand. Additionally, more variety of live seafood is available such as king crabs from Norway, snow crabs and mud crabs from Oman, Australia, New Zeal along with local hamour, halwayoo, red mullet, salmon, baby shark amongst others, making Seafood Market an absolute heaven for seafood aficionados.','<p><br></p>','Dubai','Dubai',0.00000000,'1468',0,2,50,2,'image-1717059084420.png',0,0,'2024-05-30 08:51:24'),(108,200,14,'Fujiya','Fujiya is Dubai’s original and most authentic, fun and friendly Japanese neighbourhood izakaya dining experience.','<p><br></p>','Dubai','Dubai',0.00000000,'7585',0,2,50,2,'image-1717076570671.fujiya logo.jpegpng',0,0,'2024-05-30 08:52:55'),(109,195,12,'test','test','<p>test</p>','test','test',120.00000000,'1117',0,2,1,1,'image-1717063809336.png',0,0,'2024-05-30 10:10:09'),(110,195,12,'test 2','test2','<p>test2</p>','test2','test2',123.00000000,'3729',0,2,2,2,'image-1717063897578.png',0,0,'2024-05-30 10:11:37'),(111,195,12,'test3','test3','<p>test3</p>','test3','test3',123.00000000,'1439',0,2,2,2,'image-1717063981113.png',0,0,'2024-05-30 10:13:01'),(112,195,12,'test4','test4','<p>test4</p>','test4','test4',123.00000000,'8741',0,2,4,2,'image-1717064118593.png',0,0,'2024-05-30 10:15:18'),(113,195,12,'test5','test5','<p>test5</p>','test5','test5',123.00000000,'4474',0,2,5,2,'image-1717064188391.png',0,0,'2024-05-30 10:16:28'),(114,195,12,'test6','test6','<p>test6</p>','test6','test6',123.00000000,'3157',0,2,5,2,'image-1717064383442.png',0,0,'2024-05-30 10:19:43'),(115,195,12,'test7','test7','<p>test7</p>','test7','test7',123.00000000,'5772',0,2,7,2,'image-1717064453628.png',0,0,'2024-05-30 10:20:53'),(116,195,12,'test8','test8','<p>test8</p>','test8','test8',123.00000000,'7995',0,2,8,2,'image-1717064598813.png',0,0,'2024-05-30 10:23:18'),(117,195,12,'test9','test9','<p>test9</p>','test9','test9',123.00000000,'4134',0,2,9,2,'image-1717065152475.png',0,0,'2024-05-30 10:24:51'),(118,195,12,'test10','test10','<p>test10</p>','test10','test10',123.00000000,'8842',0,2,5,2,'image-1717065258473.png',0,0,'2024-05-30 10:34:18'),(119,120,12,'test11','test','<p>test</p>','test','test',11.00000000,'2440',0,2,122,2,'image-1717066231798.png',0,0,'2024-05-30 10:50:31'),(120,120,12,'test111','test','<p>test</p>','test','test',11.00000000,'4948',0,2,122,2,'image-1717066631250.png',0,0,'2024-05-30 10:57: