art of the famed Dubai Marina and overlooking the Dubai Water Canal, Business Bay. With tranquil views of the glittering waters, embark on an exotic culinary journey from the Far East to the Middle East to discover some of the most-loved gourmet Pan-Asian flavours and aromas of the UAE.','<p>This offer is good for % off of the Spice Route Brunch at Asia Asia in Business Bay.<br><br>Brunch times: Friday and Saturday from 8PM to 11PM<br>Brunch cost: AED325<br><br>- Physical ID must be presented at the venue<br>- Discount is valid for the ID holder and one friend<br>- Discount is only valid when purcchasing the house package<br>- Offer cannot be used in conjunction with any other offer</p>','UAE','Dubai',325.00000000,'7428',1,1,26,2,'image-1722067738817.326037393_503416431861756_7323980065219812975_n.pngpng',0,1,'2024-07-27 08:08:58'),(182,274,15,'Papas Cucina Italiano Brunch','Inspired by the classic Italian trattorias and authentic hospitality, the neighbourhood eatery has been conceptualised to be bright, homely, and honest. It’s love for the little moments and simplicity of life focuses on the ‘what is’, designed to bring family, friends and experiences together.','<p>This offer is good for 16% off of the Papas brunch. <br><br> Brunch times: Saturday from 2PM to 5PM <br>Brunch cost: AED375 <br><br> - Physical ID must be presented at the venue <br>- Discount is valid for the ID holder and one friend <br>- Discount is only valid when purchasing the house package <br>- Offer cannot be used in conjunction with any other offer</p>','UAE','Dubai',375.00000000,'4802',1,1,16,2,'image-1722071977604.merchant_primary_logo_(retina)_-_merchant202312291126.jpgpng',0,1,'2024-07-27 08:18:22'),(183,274,15,'Lock Stock & Barrel Brunch','Lock, Stock and Barrel is one of Dubai\'s most dynamic live music venues. With venues on The Walk at JBR and in Barsha Heights, the high-fidelity lounges have spacious, quirky aesthetics, including warehouse-style exposed brick, industrial materials and cargo shipping containers on the walls.  Always keeping true to its live music roots, bands grace the stage on frequent occasions where you can dance and sing along to your heart’s content with the other large number of patrons. The menu on offer lets you enjoy hearty meals such as large nachos, burgers and steaks.  Visit with a group of friends or solo for a casual night of fun, food and live entertainment in one of the most popular music venues in the UAE. ','<p>This offer is good for 10% off of the Lock Stock &amp; Barrel brunch at the following locations.<br>- Business Bay<br>- Barsha Heights<br>- JBR<br><br>Brunch times: Saturday from 5PM to 8PM <br>House brunch AED250<br> Sparkling brunch AED300<br><br> - Physical ID must be presented at the venue <br>- Discount is valid for the ID holder and one friend <br>- Offer cannot be used in conjunction with any other offer</p>','UAE','Dubai',250.00000000,'1480',1,1,10,2,'image-1722071418060.lsb logo.pngpng',0,1,'2024-07-27 09:10:18'),(184,274,15,'STK Drama Day Brunch','STK Dubai JBR artfully blends the modern steakhouse and a chic lounge into one, offering a dynamic, fine dining experience with the superior quality of a traditional steakhouse. STK Dubai JBR distinguishes itself with a vibrant mix of stylish dining and lounge spaces paired with signature menus and world class service.','<p>This offer is good for 11% off of the Drama Day Brunch at STK <br><br> Brunch times: Saturday from 1PM to 4PM <br>Brunch cost: AED375<br><br> - Physical ID must be presented at the venue <br>- Discount is valid for the ID holder and one friend <br>- Discount is only valid when purchasing the house package <br>- Offer cannot be used in conjunction with any other offer</p>','UAE','Dubai',375.00000000,'9884',1,1,11,2,'image-1722071835485.Screenshot 2024-07-27 131641.pngpng',0,1,'2024-07-27 09:17:15'),(185,274,15,'STK Dare to Disco Brunch','STK Dubai JBR artfully blends the modern steakhouse and a chic lounge into one, offering a dynamic, fine dining experience with the superior quality of a traditional steakhouse. STK Dubai JBR distinguishes itself with a vibrant mix of stylish dining and lounge spaces paired with signature menus and world class service.','<p>This offer is good for 11% off of the Dare to Disco Brunch at STK <br><br>  Brunch times: Saturday from 8PM to 11PM <br> Brunch cost: AED375 <br><br> - Physical ID must be presented at the venue <br> - Discount is valid for the ID holder and one friend <br> - Discount is only valid when purchasing the house package <br> - Offer cannot be used in conjunction with any other offer</p>','UAE','Dubai',395.00000000,'6550',1,1,11,2,'image-1722073376400.Screenshot 2024-07-27 131641.pngpng',0,1,'2024-07-27 09:42:56'),(186,275,14,'Benjarong','So much more than a menu, Benjarong’s mouth-watering selection of Authentic Thai cuisine is a true culinary journey. Carefully crafted and beautifully presented by expert Thai Chef de Cuisine Wichit Panyo and his team, the multi-award-winning cuisine finds the perfect harmony and balance between the five flavours of sweet, spicy, sour, salty, and creamy, by using the freshest, finest-quality ingredients.','<p>This offer is good for 20% off of your total bill at Benjarong.</p>','UAE','Dubai',0.00000000,'5120',1,1,20,2,'image-1722183769868.305570794_450415013773425_3263159688867356138_n.jpgpng',0,1,'2024-07-28 16:22:49'),(187,275,14,'24th St.','Embark on a culinary journey like no other at 24th St., where the world’s most beloved street foods come together under one roof. Our unique World Street concept features six main kitchens, each dedicated to a distinct cuisine: Korean, Indian, Japanese, Chinese, Italian, and Arabic. Whether you’re craving the bold flavors of Korean BBQ, the intricate spices of Indian curries, or the delicate artistry of Japanese sushi, 24th St. offers an unparalleled dining experience that celebrates the rich diversity of global street food.','<p>This offer is good for 20% off of your enti