DROP TABLE IF EXISTS `planSubscription`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `planSubscription` (
  `id` int NOT NULL AUTO_INCREMENT,
  `userId` int NOT NULL,
  `planId` int DEFAULT '1',
  `cardId` int DEFAULT NULL,
  `cardNumber` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `amount` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT 'AED',
  `startTime` datetime NOT NULL,
  `endTime` datetime NOT NULL,
  `type` int NOT NULL COMMENT '1=referral subscription,2=purchase subscription',
  `stripePayementId` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `receiptUrl` text COLLATE utf8mb4_general_ci,
  `status` int NOT NULL DEFAULT '1' COMMENT '0=inActive,1=Active',
  `paymentMethod` int DEFAULT NULL COMMENT '1 - Stripe, 2 - IAP',
  `datetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `stripeResponse` text COLLATE utf8mb4_general_ci,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=95 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

