DROP TABLE IF EXISTS `userRegistration`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `userRegistration` (
  `id` int NOT NULL AUTO_INCREMENT,
  `referralId` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `referralCode` varchar(100) COLLATE utf8mb4_general_ci NOT NULL,
  `userName` text COLLATE utf8mb4_general_ci,
  `dateOfBirth` date DEFAULT NULL,
  `countryCodeId` int DEFAULT NULL,
  `countryIsoCode` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `mobileNumber` varchar(50) COLLATE utf8mb4_general_ci NOT NULL,
  `email` varchar(100) COLLATE utf8mb4_general_ci NOT NULL,
  `password` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `smartPin` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `referBy` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `isBlock` int NOT NULL DEFAULT '0' COMMENT '0=unblock, 1= block',
  `profilePic` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `QRCode` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `googleAuthCode` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `isEmailVerify` int NOT NULL DEFAULT '0',
  `isSmsVerify` int NOT NULL DEFAULT '0',
  `isVerified` int NOT NULL DEFAULT '0' COMMENT '0-pending, 1-Approve, 2-Reject',
  `registerBy` int NOT NULL,
  `registrationType` int NOT NULL DEFAULT '1' COMMENT '1-Form Login, 2-Google Login',
  `userDocument` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'teacherId',
  `rejectReason` text COLLATE utf8mb4_general_ci,
  `forgotOtp` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `gender` int DEFAULT NULL COMMENT '1 = Male, 2 = Female, 3 = Other',
  `address` text COLLATE utf8mb4_general_ci,
  `city` text COLLATE utf8mb4_general_ci,
  `pinCode` int DEFAULT NULL,
  `state` int DEFAULT NULL,
  `country` int DEFAULT NULL,
  `signupBy` int DEFAULT NULL COMMENT '1-normal, 2- gamil',
  `loginType` int NOT NULL DEFAULT '4' COMMENT '1=superAdmin,2=subAdmin,3=Vendor,4=Teacher',
  `isOfferFree` int DEFAULT '0' COMMENT '0-paid, 1-free',
  `FCM_token` text COLLATE utf8mb4_general_ci,
  `isAccountDeleted` int NOT NULL DEFAULT '0' COMMENT '1-Deleted, 0-Active',
  `deleted_date` datetime DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=621 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
